import styled, {css} from 'styled-components';

const Container = styled.div`
    width: 100%;
    height: 848px;
    background-color: #f5f5f5;
    font-weight: bold;
    font-stretch: normal;
    font-style: normal;
    letter-spacing: normal;
    text-align: center;
    color: #212121;
`;
const Text = styled.p`
    height:24px;
    font-family: Roboto;
    font-size: 16px;
    font-weight: bold;
    font-stretch
`
const Smartstore = () => {
    return(
        <Container>
            <Text>How Does MyMusicTaste Work?</Text>
        </Container>
    )
}

export default Smartstore;
